import { useRouter } from 'next/router'
import Layout from '../comps/Layout'

const Page = () => {
    const router = useRouter()

    return (
        <Layout>
            <h1>{ router.query.title }</h1>
            <p>this is post</p>
        </Layout>
    )
}

export default Page
